import React from "react";

const DownloadPhoto = (props)=>{
    const {url} = props;
    return(
        <div className="download-photo-container">
            <img className="shared-img" src={url} alt="shared-img"></img>
            <button className="hero-btn">Download</button>
        </div>
    );
};

export default DownloadPhoto;
